export const Patients =()=>{

    const [todos,setTodos] = useState([]);
    const [text,setText] = useState("");
    const [loading,setLoading] = useState(false)
    const [page,setPage] = useState(1)
  useEffect(()=>{
      getData()
    },[page])

    const getData = () =>{
        setLoading(true)
        fetch(`http://localhost:3001/patients?_page=${page}&_limit=3`).then(d=>d.json()).then(res=>{
            setTodos(res)
            setLoading(false)
        })
    }
    return (
    <div>
        
       
        {todos.map(e => <div key={e.id}>{e.title} - {e.status ? "done"  : "not done" }</div>)} 

        <button onClick={()=>{
            setPage(page - 1)
        }}
        >prev</button>
        <button onClick={()=>{
            setPage(page + 1)
        }}
        >next</button>
        </div>

        ) 
   
}
